import { Injectable } from '@angular/core';
import { Product } from 'src/app/ProductsModule/Core/Domain/Entities/Product';
import { IRepository } from 'src/app/ProductsModule/Core/Domain/Repositories/IRepository';
import { products } from 'src/app/products';


@Injectable()
export class Repository implements IRepository {

  arr: number[] = [1, 2, 3, 4, 1, 1, 1, 1, 2, 3, 5, 6, 7, 7, 8, 9, 9, 9];

  public getArrayOfNumbers(): number[] {
    return this.arr;
  }

  public getProducts(): Product[] {
    return products;
  }
}
